var text = '';


var min = text.length;


function afterReplace( newText ) {
	var chars = newText.split('');

	var ascii = [];
	
	for( var i = 0 ; i < chars.length ; i ++ ) {
		var c = chars[i];
		if( c ) {
			ascii.push( c.charCodeAt() );
		}
	}
	
	for( var i = 0 ; i < ascii.length - 1 ; ) {
		var sub = ascii[i] - ascii[i+1];
		if( Math.abs( sub ) == 32 ) {
			if( String.fromCharCode(ascii[i]).toUpperCase() == String.fromCharCode(ascii[i+1]).toUpperCase() ) {
			  ascii.splice( i, 2 );
			  i --;
			}
		} else {
		  i ++;
		}
	}
	
	if( min > ascii.length ) {
		min = ascii.length;
	}
}

for( var i = 65; i <=90; i ++ ) {
	var replaceChar = String.fromCharCode( i );
	var reg = new RegExp( replaceChar, 'g' );
	var newText = text.replace( reg, '' );
	
	replaceChar = String.fromCharCode( i + 32 );
	reg = new RegExp( replaceChar, 'g' );
	newText = newText.replace( reg, '' );
	afterReplace( newText );
} ;
console.info( min );